import { Fragment } from "react/cjs/react.development";
import classes from "./HeaderCartButton.module.css";

const HeaderCartButton = (props) => {
  return (
    <Fragment>
      <button className={classes.button}>Cart</button>
    </Fragment>
  );
};

export default HeaderCartButton;
